import * as React from "react";

export const Terminal = () => {
  return (
    <div>
      <h1>Terminal</h1>
      <p>This is going to be a terminal soon.</p>
      <Textbox />
    </div>
  );
};

function Textbox() {
  return <textarea width="100%" height="100px"></textarea>;
}
